import React from 'react';
import './App.css';
import Header from './Header';
import Login from './Login';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Register from './Register';

function App() {
  return (

    <div className="App">

      <Router>

        <Header />

        <Switch>
          <Route path="/register"> 
            <Register/>
          </Route>
          <Route path="/login">
            <div className="App__login">
              <Login />
            </div>
          </Route>
          <Route path="/">

            <h1>Home page</h1>
          </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
